import { Router } from './components/utils/Router';


function App() {
  return (
    <div className=" bg-gradient-to-r from-slate-900 via-purple-900 to-slate-900 w-screen h-screen flex flex-col">
      <Router/> 
    </div>
  );
}

export default App;
